import '../../utils/style/header.css';
import img from '../../assets/img.svg';
import styled from 'styled-components';


const BannerWrapper = styled.div `

    width: 1240px;
    height: 68px;
    display: flex;
    justify-content: space-between;
    line-height: 50%;
    margin: auto;
    margin-top: 20px;

    `

const KasaTitle =  styled.div `

    color :#FF6060; 
    text-align: left;
    padding: 32px; 
    font-size: 40px;
`

const KasaLogo =  styled.img `
    margin-left: 10px;

`


const BannerNavigation = styled.nav `

    height: 24px;
    display: flex;
    justify-content: space-between;
    height: 68px;
  `



const BannerLink = styled.a `

    width: 136px;
    height: 34px;


    font-family: 'Montserrat';
    font-style: normal;
    font-weight: 500;
    font-size: 24px;
    /* or 34px */
    display: flex;
    align-items: flex-end;
    text-align: right;
    text-decoration-line: underline;
    line-height: 60%;
    color: #FF6060;
`



function Header() {

	return (<BannerWrapper>
			 <KasaLogo src={img} alt="logo kasa"/>
			 <BannerNavigation>
				<BannerLink href='/'>Accueil</BannerLink>
				<BannerLink className= 'banner_link_Apropos' href='/Apropos'>A Propos</BannerLink>
			 </BannerNavigation>
	       </BannerWrapper>)
}

export default Header
